import React from 'react';
import './App.css';
//routing imports 
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import ProtectedRoute from './ProtectedRoute';
//Theme imports 
import { theme, ThemeProvider } from "@chakra-ui/core";
import tabsystemTheme from './GlobalStyles/Theme';
//Component imports 
import Login from './Components/Login';
import Home from './Components/Home';
//Protected Component imports
import Register from './ProtectedComponents/Register';
import Dashboard from './ProtectedComponents/Dashboard';
import Tabs from './ProtectedComponents/Tabs';

function App() {
  return (
    <Router>
      <ThemeProvider theme={tabsystemTheme}>
        <Switch>
          <Route path="/login" exact component={Login} />
          <Route path="/" exact component={Home} />
          <ProtectedRoute path="/register" exact component={Register}/>
          <ProtectedRoute path="/dashboard" exact component={Dashboard}/>
          <ProtectedRoute path="/tabs" exact component={Tabs}/>
        </Switch>
      </ThemeProvider>
    </Router>
  );
}

export default App;
